/**
https://leetcode.com/problems/making-a-large-island/
https://leetcode.com/problems/island-perimeter/description/
 */
const largestIsland = (grid) => {
  const r = grid.length
  const c = grid[0].length
  const visited = Array(r).fill().map(() => Array(c).fill(0))
  const paths = [[0, 1], [0, -1], [1, 0], [-1, 0]]
  const isValid = (i, j) => {
    if ((i < 0 || j < 0 || i >= r || j >= c)) return false
    return grid[i][j] == 1
  }
  const colorCount = {}
  const bfs = (i, j, color) => {
    const queue = []
    queue.push([i, j])
    let qIndex = 0
    visited[i][j] = true
    while (qIndex <= queue.length && queue[qIndex]) {
      // const current = queue.shift()
      const current = queue[qIndex]
      qIndex++
      const [x, y] = current
      colorCount[color] = (colorCount[color] || 0) + 1
      // console.log(x + '-' + y, colorCount)
      // fill the color
      grid[x][y] = color
      for (const p of paths) {
        const new_x = p[0] + x
        const new_y = p[1] + y
        if (isValid(new_x, new_y) && !visited[new_x][new_y]) {
          queue.push([new_x, new_y])
          visited[new_x][new_y] = true
        }
      }
    }
  }

  // find all the islands first
  let ans = 0
  let color = 0
  for (let i = 0; i < r; i++) {
    for (let j = 0; j < c; j++) {
      if (!visited[i][j] && grid[i][j] == 1) {
        bfs(i, j, ++color)
        ans = Math.max(ans, colorCount[color])
      }
    }
  }
  // console.info(colorCount)
  // console.info(`max Area before flipping`, ans)
  const isValidNeighbor = (i, j) => {
    if (i < 0 || j < 0 || i >= r || j >= c) return false
    return (i >= 0 && j >= 0 && grid[i][j] != 0)
  }
  const fetchNeighborOfIslands = (x, y) => {
    const neighborsColor = new Set() // get unique Color
    for (const p of paths) {
      const new_x = x + p[0]
      const new_y = y + p[1]
      if (isValidNeighbor(new_x, new_y)) {
        neighborsColor.add(grid[new_x][new_y])
      }
    }
    return [...neighborsColor]
  }
  // iterate through the grid and flip one side to find its neighbor and new area
  for (let i = 0; i < r; i++) {
    for (let j = 0; j < c; j++) {
      if (grid[i][j] == 0) {
        const neighbors = fetchNeighborOfIslands(i, j)
        const isLandCount = neighbors.reduce((p, c) => p + colorCount[c], 1) // 1 is for converting a zero to 1
        ans = Math.max(ans, isLandCount)
      }
    }
  }
  console.info('---'.repeat(10))
  console.info('max Area of island after flipping is ', ans)
  return ans
}

